  Monday, October 5, 2020 - 10:00am to 1:30pmHalf-day TutorialsIntroduction to AI TestingHow do you train an AI bot to do your software testing? Integrating AI into your testing activities can be intimidating, but in reality, it is pretty easy, and it just takes some understanding and work. Learn how to directly apply AI to real-world testing problems without having a Ph.D. in computer science. Jennifer will share a wide survey of all the different ways AI is applied to software testing today. Get some hands-on experience using AI with a testing focus with no coding skills required. Whether you are just AI-Curious or want to reap the benefits of AI-based testing approaches on your product today, this workshop is a must to get an understanding of where testing, and your career, are headed in an AI-First world. Jennifer will also reserve time for Q&A to discuss applying AI-based testing approaches to your individual testing problems. This workshop will get you ready for the AI-Based future of testing!” Leave this session knowing how to start using AI, where AI can be applied to software testing, benefits of AI first testing approach, practice with AI using an open-source tool, different tool options for AI in a testing tool-agnostic approach.

